import Counter from "./Counter";
import CounterHook from "./CounterHook";

export const ThemeContext = React.createContext();

function App() {
  const App = {
    width: "10%",
    margin: "0 auto",
    fontSize: "30px",
  };

  return (
    <div style={App}>
      <span style={{ textAlign: "center" }}>Conuter</span>
      <Counter initialCounter={0} />
      <br></br>
      <span>ConuterHook</span>
      <CounterHook initialCounter={0} />
    </div>
  );
}

export default App;
